import React , {Component} from 'react';
import App from './App';
class Items extends Component{
    render()
    {
        const users = [
            id='1',
            name='omar',
            age='10'
        ];
     
      return (
        users.map({id :"1",name : 'mazen',age : '88'})
      

        );
    }
}
export default Items;
